import {useEffect, useState, useRef} from 'react';

function List() {
    
    const [list, setList] = useState([]);

    useEffect(()=>{
        fetch("http://127.0.0.1:8081/gettasks")
        .then(response => response.text())
        .then(setList);
    }, []);

    // console.log(JSON.parse(data).map(v => v['description'])

    return (
        <ul>
           {list.map(todo => 
            <li key={todo.id}>{todo.description}</li>)}
         </ul>
       );
    
}

export default List;
